#include <iostream>
#include <vector>
#include <ctime>
using namespace std;

class Solution {
public:
    bool isPalindrome (string s) {
        string::size_type first=1, last=s.size()-2;
        while (first < last) {
            if (s[first] != s[last]) {
                return false;
            }
            ++first;--last;
        }
        return true;
    }
    string shortestPalindrome(string s) {
        clock_t start = clock();
        clock_t end;
        if (s.size() == 0 || s.size() == 1) {
            return s;
        }
        string::size_type longest_first_repeat=1;
        end = clock();
        cout << "Time for now: " << end - start << endl;
        for(string::size_type i = s.size()-1; i!= 0; --i) {
            if (s[i] == s[0]) {
                end = clock();
                cout << "Time for now: " << end - start << endl;
                if (isPalindrome(s.substr(0, i+1))) {
                    end = clock();
                    cout << "Time for now: " << end - start << endl;
                    longest_first_repeat = i+1;
                    break;
                }
            }
        }

        string rest = s.substr(longest_first_repeat, s.size()-longest_first_repeat);
        reverse(rest.begin(), rest.end());

        return rest+s;
    }
};
int main() {
    clock_t start = clock();
    cout << Solution().shortestPalindrome("") << endl;
    clock_t end = clock();
    cout << "Time used: " << end - start << endl;
    return 0;
}
